def qiskit_sim(qiskitqc: qiskitQC):
    sim_statevector = AerSimulator(method='statevector')
    job_statevector = sim_statevector.run(qiskitqc, shots=20000)
    counts_statevector = job_statevector.result().get_counts(0)
    return counts_statevector

def quafu_sim(qc: QuantumCircuit):
    res = simulate(qc, shots=10000).counts
    return res

def plot_probabilities(sampling_results):
    """
    Plot the probabilities from execute results.
    """
    sampling_results = {k: sampling_results[k] for k in sorted(sampling_results, key=lambda x: int(x, 2))}
    bitstrs = list(sampling_results.keys())
    probs = list(sampling_results.values())
    plt.figure()
    plt.bar(range(len(probs)), probs, tick_label = bitstrs)
    plt.xticks(rotation=70)
    plt.ylabel("probabilities")
    plt.tight_layout()
    plt.show()

