from quafu.elements import Parameter
from quafu.elements.element_gates import RYGate, RZGate, CXGate
from quafu.algorithms.hamiltonian import Hamiltonian, PauliOp

n = 3
d = 3
g = 0.5
ansatz_circuit = QuantumCircuit(n)
x0 = np.random.rand(n * d * 3)
theta = np.array([Parameter("theta_%d" % (i), x0[i]) for i in range(n * d * 3)])
theta = np.reshape(theta, [d, n, 3])

for j in range(d):
    for i in range(n):
        ansatz_circuit << RZGate(i, theta[j, i, 0])
        ansatz_circuit << RYGate(i, theta[j, i, 1])
        ansatz_circuit << RZGate(i, theta[j, i, 2])
    for i in range(n):
        ansatz_circuit << CXGate(i, (i + 1) % n)

ansatz_circuit.measure([q for q in range(n)], [q for q in range(n)])
ansatz_circuit.draw_circuit()

ising_terms = [PauliOp(f"Z{j} Z{j + 1}", -1.) for j in range(n - 1)]
ising_terms.extend([PauliOp(f"X{j}", g) for j in range(n)])
ising_terms = [PauliOp("Y0 Z1 X2", -1.3)]
ising_terms.extend([PauliOp("X0 Y1 Z2", 0.8)])

# ising_terms = [PauliOp("Z0 X1", -0.5)]
# ising_terms = [PauliOp("X0 Y1 Z2", 0.8)]
# ising_terms = [PauliOp(f"X{j}", g) for j in range(n)]
hamiltonian = Hamiltonian(ising_terms)
h_mat = hamiltonian.get_matrix(n)
from numpy.linalg import eigvalsh

h_mat = h_mat.toarray()
exact = eigvalsh(h_mat)[0]
print("exact: ", exact)

initial_paras = list(np.random.rand(n * d * 3))

# hamiltonian.to_legacy_quafu_pauli_list()

st = time.time()
# vqe = VQE(ansatz_circuit, hamiltonian, initial_paras, maxiter=15, backend='local_qpu')
vqe = VQE(ansatz_circuit, hamiltonian, initial_paras, maxiter=100,
          default_backend="simulator",
          default_gradient="finite-diff", user_backend=None)
vqe_results = vqe.run()
print(time.time() - st)

ansatz_circuit.draw_circuit()

plt.plot(vqe_results.cost_values)
plt.xlabel('Iteration')
plt.ylabel('Objective function value')
plt.title('Optimization Progress')
plt.axhline(exact, linestyle='--', color='k')
plt.show()